"use strict";(self.webpackChunkgiveth_docs=self.webpackChunkgiveth_docs||[]).push([[8020],{7545:e=>{e.exports=JSON.parse('{"pluginId":"dapps","version":"current","label":"Next","banner":null,"badge":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"dapps":[{"type":"category","label":"DApp Belgeleri","items":[{"type":"category","label":"Kullan\u0131c\u0131 K\u0131lavuzlar\u0131","collapsed":true,"items":[{"type":"category","label":"Giveth.io","collapsed":true,"items":[{"type":"link","label":"Ba\u015flarken","href":"/tr/dapps/gettingStarted","docId":"gettingStarted"},{"type":"link","label":"Kripto para ba\u011f\u0131\u015flar\u0131","href":"/tr/dapps/crypto","docId":"crypto"},{"type":"link","label":"Proje olu\u015ftur","href":"/tr/dapps/createproject","docId":"createproject"},{"type":"link","label":"Proje Kalite G\xfcvencesi K\u0131lavuzu","href":"/tr/dapps/listedUnlisted","docId":"listedUnlisted"},{"type":"link","label":"Proje Do\u011frulama S\xfcreci ve Y\xf6nergeleri","href":"/tr/dapps/projectVerification","docId":"projectVerification"},{"type":"link","label":"Bir Projeye Nas\u0131l Ba\u011f\u0131\u015f Yapabilirim?","href":"/tr/dapps/projectdonating","docId":"projectdonating"},{"type":"category","label":"C\xfczdanlar","items":[{"type":"link","label":"Torus C\xfczdan Kullan\u0131m\u0131","href":"/tr/dapps/torusUserGuide","docId":"torusUserGuide"},{"type":"link","label":"Torus Fiat Para Ge\xe7i\u015fi ile Ba\u011f\u0131\u015f Yapma","href":"/tr/dapps/torusonramp","docId":"torusonramp"},{"type":"link","label":"Torus \xd6zel Anahtar\u0131n\u0131 Metamask\'a Aktarma","href":"/tr/dapps/importTorusMM","docId":"importTorusMM"},{"type":"link","label":"Metamask ile Ba\u011f\u0131\u015f Yapmak","href":"/tr/dapps/donatingmetamask","docId":"donatingmetamask"}],"collapsed":true,"collapsible":true},{"type":"link","label":"Sorun Giderme","href":"/tr/dapps/troubleshooting","docId":"troubleshooting"},{"type":"link","label":"S\u0131k\xe7a Sorulan Sorular","href":"/tr/dapps/faq","docId":"faq"}],"collapsible":true,"href":"/tr/dapps/givethIO"},{"type":"category","label":"Giveth TRACE (Deprecated)","items":[{"type":"link","label":"Giveth Entities and Roles","href":"/tr/dapps/entitiesAndRoles","docId":"entitiesAndRoles"},{"type":"link","label":"Getting your project on TRACE","href":"/tr/dapps/makeTraceableProject","docId":"makeTraceableProject"},{"type":"link","label":"Leaving Traces (formerly Creating Milestones)","href":"/tr/dapps/leavingTraces","docId":"leavingTraces"},{"type":"link","label":"Technical White Paper","href":"/tr/technicalWhitePaper","docId":"technicalWhitePaper"},{"type":"link","label":"Exchange Rates","href":"/tr/dapps/exchangeRates","docId":"exchangeRates"},{"type":"link","label":"Contracts, Bridges and Multisigs Technical Information","href":"/tr/dapps/traceContracts","docId":"traceContracts"}],"collapsed":true,"collapsible":true,"href":"/tr/dapps/introTrace"},{"type":"category","label":"GIVeconomy","items":[{"type":"link","label":"GIVdrop","href":"/tr/giveconomy/givdrop","docId":"givdrop"},{"type":"link","label":"GIVbacks","href":"/tr/giveconomy/givbacks","docId":"givbacks"},{"type":"link","label":"Giveth E\u015fle\u015ftirme Havuzu","href":"/tr/givethMatchingPool","docId":"givethMatchingPool"},{"type":"link","label":"GIVstream","href":"/tr/giveconomy/givstream","docId":"givstream"},{"type":"category","label":"GIVgarden","items":[{"type":"link","label":"Terms & Conditions for Submitting or Challenging a Proposal","href":"/tr/giveconomy/termsForProposals","docId":"termsForProposals"}],"collapsed":true,"collapsible":true,"href":"/tr/giveconomy/givgarden"},{"type":"category","label":"GIVfarm","items":[{"type":"link","label":"Regen Farms","href":"/tr/regenFarms","docId":"regenFarms"},{"type":"link","label":"Melek Kasas\u0131","href":"/tr/angelVault","docId":"angelVault"}],"collapsed":true,"collapsible":true,"href":"/tr/giveconomy/givfarm"},{"type":"link","label":"GIVpower","href":"/tr/giveconomy/givpower","docId":"givpower"},{"type":"link","label":"$nice Token Nedir?","href":"/tr/giveconomy/niceToken","docId":"niceToken"},{"type":"link","label":"The Givers PFP Collection","href":"/tr/dapps/giverspfp","docId":"giverspfp"}],"collapsed":true,"collapsible":true,"href":"/tr/giveconomy/"}],"collapsible":true},{"type":"category","label":"Geli\u015ftirici K\u0131lavuzlar\u0131","items":[{"type":"link","label":"Giveth Geli\u015fimine Katk\u0131da Bulunma","href":"/tr/dapps/contributors","docId":"contributors"},{"type":"category","label":"Giveth.io","items":[{"type":"link","label":"Local Geli\u015ftirme i\xe7in Giveth.io Kurulumu","href":"/tr/dapps/givethioinstallation","docId":"givethioinstallation"},{"type":"link","label":"Giveth.io Testing Guidelines","href":"/tr/dapps/testing-guidelines","docId":"testing-guidelines"}],"collapsed":true,"collapsible":true},{"type":"category","label":"Giveth TRACE (Deprecated)","items":[{"type":"link","label":"Installing Giveth TRACE for Local Development","href":"/tr/dapps/TRACEinstallation","docId":"TRACEinstallation"},{"type":"link","label":"Giveth Bridge Security Implementation","href":"/tr/dapps/bridgeSecurity","docId":"bridgeSecurity"},{"type":"link","label":"Development Process","href":"/tr/dapps/developmentProcess","docId":"developmentProcess"}],"collapsed":true,"collapsible":true},{"type":"category","label":"GIVeconomy","items":[{"type":"link","label":"GIVeconomy Front-End Kurulumu","href":"/tr/dapps/installGIVeconomy","docId":"installGIVeconomy"},{"type":"link","label":"GIVeconomy Test Rehberi","href":"/tr/dapps/testingGIVeconomy","docId":"testingGIVeconomy"},{"type":"link","label":"Regen Farm Ak\u0131ll\u0131 Kontrat Rehberi","href":"/tr/dapps/regenFarmContracts","docId":"regenFarmContracts"}],"collapsed":true,"collapsible":true}],"collapsed":true,"collapsible":true}],"collapsed":true,"collapsible":true,"href":"/tr/dapps/"}]},"docs":{"angelVault":{"id":"angelVault","title":"Melek Kasas\u0131","description":"Melek Kasas\u0131, GIV\'i a\u015fa\u011f\u0131 y\xf6nl\xfc fiyat oynakl\u0131klar\u0131ndan korumak amac\u0131yla yap\u0131land\u0131r\u0131lm\u0131\u015f, stratejik olarak y\xf6netilen bir Univ3 pozisyonudur. 4/7 \xe7oklu izmac\u0131 Giveth \xe7ekirdek ekip \xfcyeleri ve ICHI\'den iki \xfcye olan Melek Kasas\u0131 \xe7oklu imzac\u0131lar\u0131m\u0131z taraf\u0131ndan y\xf6netilmektedir. Melek Kasa\'lar ve nas\u0131l \xe7al\u0131\u015ft\u0131klar\u0131 hakk\u0131nda daha fazla bilgi edinmek i\xe7in l\xfctfen ICHI d\xf6k\xfcmanlar\u0131na g\xf6z at\u0131n.","sidebar":"dapps"},"bridgeSecurity":{"id":"bridgeSecurity","title":"Giveth Bridge Security Implementation","description":"A technical overview of the features, roles and theory behind the security of the Giveth Bridge.","sidebar":"dapps"},"contributors":{"id":"contributors","title":"Giveth Geli\u015fimine Katk\u0131da Bulunma","description":"Giveth \u015fu anda fon y\xf6netimine, e\u015fler aras\u0131 ba\u011f\u0131\u015flara ve daha iyi token ekonomisi i\xe7in DeFi\'ya odaklanan \xfc\xe7 \xfcr\xfcne sahip. Bunlar s\u0131ras\u0131yla Giveth TRACE, Giveth.io ve GIVeconomy\'dir.","sidebar":"dapps"},"createproject":{"id":"createproject","title":"Proje olu\u015ftur","description":"","sidebar":"dapps"},"crypto":{"id":"crypto","title":"Kripto para ba\u011f\u0131\u015flar\u0131","description":"Kripto para nedir ve neden kripto para kullan\u0131yoruz?","sidebar":"dapps"},"developmentProcess":{"id":"developmentProcess","title":"Development Process","description":"This section details the Giveth TRACE development process, deployments, and how merging and testing is handled.","sidebar":"dapps"},"donatingmetamask":{"id":"donatingmetamask","title":"Metamask ile Ba\u011f\u0131\u015f Yapmak","description":"","sidebar":"dapps"},"entitiesAndRoles":{"id":"entitiesAndRoles","title":"Giveth Entities and Roles","description":"Content and ideas have been modified from this excellent article \u201cAn Overview of the Giveth Donation Application\u201d authored by Kris Decoodt in 2017. Many things have been revised and modified since 2017. Here we breakdown the DApp as it is in 2022.","sidebar":"dapps"},"exchangeRates":{"id":"exchangeRates","title":"Exchange Rates","description":"When you leave a Trace within Giveth TRACE, you can enter an amount in ether or in fiat. Our system then automatically calculates the conversion rate based on the date of the Trace.","sidebar":"dapps"},"faq":{"id":"faq","title":"S\u0131k\xe7a Sorulan Sorular","description":"Torus nedir? En ayr\u0131nt\u0131l\u0131 yan\u0131t i\xe7in bkz. https//app.tor.us/","sidebar":"dapps"},"gettingStarted":{"id":"gettingStarted","title":"Ba\u015flarken","description":"Giveth.io, sahip oldu\u011funuz hem kripto para hem de fiat para ile projeleri kolayca destekleyebilece\u011finiz bir platformdur \u2764\ufe0f. Kendi projenizi olu\u015fturarak  d\xfcnyan\u0131n her yerindeki ba\u011f\u0131\u015f\xe7\u0131lardan finansman sa\u011flayabilirsiniz.","sidebar":"dapps"},"givbacks":{"id":"givbacks","title":"GIVbacks","description":"GIVbacks, ba\u011f\u0131\u015f\xe7\u0131lar\u0131 GIV tokenlar\u0131 ile do\u011frulanm\u0131\u015f projelere \xf6d\xfcllendiren devrim niteli\u011finde bir kavramd\u0131r. Bir GIVbacks turu s\u0131ras\u0131nda do\u011frulanm\u0131\u015f projelere verdi\u011finizde, tur sona erdikten ve GIV talep etmeye haz\u0131r olduktan sonra GIV \xf6d\xfcllerini almaya hak kazan\u0131rs\u0131n\u0131z. G\xfcncel bilgileri, program\u0131 ve talep edilebilir GIV\'nizi GIVbacks sayfas\u0131nda g\xf6rebilirsiniz.","sidebar":"dapps"},"givdrop":{"id":"givdrop","title":"GIVdrop","description":"GIVdrop, GIV tokenlar\u0131n\u0131 Giveth g\xfcvenilir tohum \xfcyelere, kripto hay\u0131rseverlerine, Giveth kullan\u0131c\u0131lar\u0131 ve geli\u015ftiricilerine, Blockchain4Good DAO \xfcyelerine ve di\u011fer ekosistem ortaklar\u0131na da\u011f\u0131tarak GIVeconomy\'yi ba\u015flatmak i\xe7in tasarlanm\u0131\u015ft\u0131r. GIVdrop uygunlu\u011funuzu kontrol etmek veya talepte bulunmak i\xe7in buraya t\u0131klay\u0131n. GIVdrop\'unuzu nas\u0131l talep edece\u011finizi \xf6\u011frenmek i\xe7in a\u015fa\u011f\u0131daki e\u011fitici yaz\u0131m\u0131za bak\u0131n.","sidebar":"dapps"},"giveconomy":{"id":"giveconomy","title":"GIVeconomy","description":"Giveth, projelere, topluma ve d\xfcnyaya verenleri g\xfc\xe7lendiren ve \xf6d\xfcllendiren bir ba\u011f\u0131\u015f k\xfclt\xfcr\xfc in\u015fa ediyor. Amac\u0131m\u0131z, toplulu\u011fumuza kolektif destek, bolluk ve de\u011fer yaratma ekosistemine kat\u0131lmalar\u0131 i\xe7in ilham vermektir. GIVeconomy\'ye ho\u015f geldiniz.","sidebar":"dapps"},"giverspfp":{"id":"giverspfp","title":"The Givers PFP Collection","description":"\u201cThe Givers\u201d NFT\u2019s are not just NFT\u2019s but integrated Giveth PFPs! Giveth\'s first PFP collection was a community proposed initiative begun in March 2022. The intention of the PFP collection is to raise funds for the Giveth DAO and continue our mission of building the Future of Giving. The Givers was launched for public minting on March 24, 2023 at 11am CST.","sidebar":"dapps"},"givethIO":{"id":"givethIO","title":"Giveth.io\'ya Giri\u015f","description":"Mart 2021\'de hayata g\xf6zlerini a\xe7an Giveth.io, insanlar\u0131n Ethereum arac\u0131l\u0131\u011f\u0131yla projelere ba\u011f\u0131\u015f yapmas\u0131 i\xe7in basit ve ak\u0131c\u0131 bir yol sunuyor.","sidebar":"dapps"},"givethioinstallation":{"id":"givethioinstallation","title":"Local Geli\u015ftirme i\xe7in Giveth.io Kurulumu","description":"Bu k\u0131lavuz, geli\u015ftirme amac\u0131yla Giveth.io\'yu yerel olarak kurma ve \xe7al\u0131\u015ft\u0131rma ad\u0131mlar\u0131n\u0131 belgeleyecektir. Kurulum i\u015flemi Ubuntu 20.04 LTS kullan\u0131larak belgelenmi\u015ftir.","sidebar":"dapps"},"givethMatchingPool":{"id":"givethMatchingPool","title":"Giveth E\u015fle\u015ftirme Havuzu","description":"Giveth E\u015fle\u015ftirme Havuzu, Giveth\'teki do\u011frulanm\u0131\u015f projelere da\u011f\u0131t\u0131lmak \xfczere ba\u011f\u0131\u015flar toplar. Bu havuz, GIVback\'lerle \xf6d\xfcllendirilirken kamu mallar\u0131 \xfczerinde geni\u015f bir etki yaratmak isteyen ba\u011f\u0131\u015f\xe7\u0131lar i\xe7in m\xfckemmeldir.","sidebar":"dapps"},"givfarm":{"id":"givfarm","title":"GIVfarm","description":"GIVfarm 24 Aral\u0131k 2021 tarihinde ba\u015flat\u0131ld\u0131. Toplam token arz\u0131n\u0131n %3,5\'i, 35 Milyon GIV, 6 ayl\u0131k ilk GIVfarm turuna tahsis edildi, 65 milyon token gelecekteki projelerde likidite sa\u011flamak i\xe7in bir multisig\'de tutuluyor. \xc7iftlikler, Ethereum Mainnet (ETH) veya Gnosis Chain (eski ad\u0131yla xDai Network) \xfczerinde mevcuttur. Tokenlar\u0131 yat\u0131rd\u0131\u011f\u0131n\u0131z herhangi bir \xe7iftlik, GIV \xf6d\xfclleri verecek ve yaln\u0131zca ilgili zincir i\xe7in GIVstream ak\u0131\u015f h\u0131z\u0131n\u0131za eklenecektir. Mevcut 6 havuz i\xe7in GIV \xf6d\xfcl da\u011f\u0131l\u0131m\u0131 a\u015fa\u011f\u0131daki gibidir:","sidebar":"dapps"},"givgarden":{"id":"givgarden","title":"GIVgarden","description":"Giveth, GIV token sahiplerinin DAO y\xf6netmesine ve misyon, vizyon ve de\u011ferleriyle uyumlu projelere fon tahsis etmesine izin vermek i\xe7in 1hive taraf\u0131ndan geli\u015ftirilen Gardens DAO y\xf6neti\u015fim platformunu se\xe7ti. E\u015fsiz Giveth Garden, \\"GIVgarden\\" olarak adland\u0131r\u0131lm\u0131\u015ft\u0131r ve Gnosis Chain\'de (eski ad\u0131yla xDai Network) konu\u015fland\u0131r\u0131lm\u0131\u015ft\u0131r. GIVgarden\'da y\xf6neti\u015fim i\xe7in kullan\u0131lan ana ara\xe7lar Kanaat Oylamas\u0131 ve Tao Oylamas\u0131d\u0131r.","sidebar":"dapps"},"givpower":{"id":"givpower","title":"GIVpower","description":"GIVpower, projeler ve ba\u011f\u0131\u015f\xe7\u0131lar aras\u0131nda kazan-kazan bir ili\u015fkisi olu\u015fturmak i\xe7in olu\u015fturuldu. GIV sahipleri, GIV tokenlerini GIVfarm\'da stake ettiklerinde ve kilitlediklerinde(iste\u011fe ba\u011fl\u0131) GIVpower ve kazan\xe7 elde ederler. Nihayetinde bu GIVpower\'lar\u0131n\u0131 Giveth\'teki projeleri \\"desteklemek\\"\ud83d\ude80 i\xe7in kullanabilecekler ve projelerin s\u0131ralamalar\u0131n\u0131 y\xfckseltmeye yard\u0131mc\u0131 olacaklar. En \xfcst s\u0131ralarda yer alan projeler platformda avantajlar elde edecek. Ba\u015flang\u0131\xe7ta proje ba\u011f\u0131\u015f\xe7\u0131lar\u0131 daha fazla GIVback alacak ve sonunda proje e\u015fle\u015fen fonlar\u0131 ve di\u011fer faydalar\u0131 elde edecek..","sidebar":"dapps"},"givstream":{"id":"givstream","title":"GIVstream","description":"Geni\u015fleyen GIViverse\'e ho\u015f geldiniz! GIVstream, topluluk \xfcyelerini Giveth ve GIVeconomy\'nin uzun vadeli ba\u015far\u0131s\u0131yla birle\u015ftiriyor. GIVstream ile, GIVeconomy\'ye de\u011fer katan herkes, GIVeconomy lansman tarihinden itibaren 5 y\u0131l boyunca s\xfcrekli olarak GIV alacakt\u0131r. GIVeconomy m\xfctevaz\u0131 bir \u015fekilde ba\u015fl\u0131yor, ancak zaman ge\xe7tik\xe7e GIViverse geni\u015fleyecektir: Daha fazla GIV likit haline gelecek ve GIVernauts toplulu\u011fumuza akacakt\u0131r.","sidebar":"dapps"},"importTorusMM":{"id":"importTorusMM","title":"Torus \xd6zel Anahtar\u0131n\u0131 Metamask\'a Aktarma","description":"Torus c\xfczdan\u0131, kriptoya yeni ba\u015flayanlar i\xe7in harika bir se\xe7enek olsa da merkeziyetsiz uygulamalarla (dApp\'ler) etkile\u015fim kurarken kullan\u0131m\u0131 daha zor olabilir. Giveth kullan\u0131c\u0131lar\u0131, GIVeconomy ile etkile\u015fime girerek GIV kazanma f\u0131rsat\u0131na sahiptir. Torus kullan\u0131c\u0131lar\u0131 GIVback talep edebilir, GIVfarm\'da tokenlar\u0131n\u0131 stake edebilir, GIVstream\'lerini talep edebilir ve GIVdroplar\u0131n\u0131 talep edebilir (e\u011fer uygunsa), ancak MetaMask kullan\u0131c\u0131lar\u0131 daha ak\u0131c\u0131 bir kullan\u0131c\u0131 deneyiminden faydalan\u0131r. Ek olarak, \u015fu anda GIVgarden, Torus c\xfczdan entegrasyonunu i\xe7ermemektedir. Web3 toplulu\u011funa tam olarak entegre olma ara\xe7lar\u0131yla yeni gelen kullan\u0131c\u0131lar\u0131 kriptoya adapte etmek istiyoruz. MetaMask, g\xfcvenli bir kripto c\xfczdan\u0131 ve blok zinciri uygulamalar\u0131na y\xfcksek d\xfczeyde optimize edilmi\u015f bir a\u011f ge\xe7ididir. Bu k\u0131lavuzun amac\u0131, Torus \xf6zel anahtar\u0131n\u0131n MetaMask\'a nas\u0131l aktar\u0131laca\u011f\u0131n\u0131 a\xe7\u0131klamak ve b\xf6ylece daha geni\u015f i\u015flevsellik sa\u011flamakt\u0131r. MetaMask c\xfczdan\u0131na nas\u0131l ba\u015flayaca\u011f\u0131n\u0131zla ilgili talimatlar i\xe7in Metamask ekibinin bu makalesine g\xf6z at\u0131n.","sidebar":"dapps"},"installGIVeconomy":{"id":"installGIVeconomy","title":"GIVeconomy Front-End Kurulumu","description":"GIVeconomy front-end\'ini i\xe7eren Github reposunu https://github.com/Giveth/liquidity-mining-dapp adresinde bulabilirsiniz.","sidebar":"dapps"},"introTrace":{"id":"introTrace","title":"Intro to Giveth TRACE","description":"Giveth is re-engineering charitable giving, by creating entirely free, open-source platforms, built on the Ethereum Blockchain. Giveth TRACE cuts out bureaucracy and enables makers to create a high level of transparency and accountability for Givers. The basic donation hierarchy of Communities, Campaigns and Traces allows for users to specify the scope of their donation. There are multiple reviewer roles and security check points that allow Givers and Makers to use our DApp with confidence. You can read more about the basic components and the logic behind our DApp (Donation Application) in this post.","sidebar":"dapps"},"leavingTraces":{"id":"leavingTraces","title":"Leaving Traces (formerly Creating Milestones)","description":"Welcome! If you are super new to Giveth, join the #\ud83d\udd28contribute channel on Discord. You can introduce yourself and ask questions there! This is a living document and will change as bugs are fixed and features added to the DApp.","sidebar":"dapps"},"listedUnlisted":{"id":"listedUnlisted","title":"Proje Kalite G\xfcvencesi K\u0131lavuzu","description":"DApp\'imizdeki projelerin kalitesini sa\u011flama amac\u0131yla, Giveth ana sayfas\u0131nda g\xf6sterilmeden \xf6nce \xf6n eleme projeleri i\xe7in bir s\xfcre\xe7 uygulad\u0131k. T\xfcm yeni projeler, bir Giveth Unicorn taraf\u0131ndan g\xf6zden ge\xe7irilip onaylanana kadar ba\u015flang\u0131\xe7ta liste d\u0131\u015f\u0131d\u0131r. Listelenmemi\u015f projeler hala ba\u011f\u0131\u015f alabilir ve projenin URL\'si arac\u0131l\u0131\u011f\u0131yla eri\u015filebilir. Ancak Giveth ana sayfas\u0131 ve projeleri sayfas\u0131nda s\u0131ralama, filtreleme ve arama i\u015flevlerimizi kullanan yaln\u0131zca listelenen projeler g\xf6r\xfcnecektir.","sidebar":"dapps"},"makeTraceableProject":{"id":"makeTraceableProject","title":"Getting your project on TRACE","description":"This guide will show you how to make your project traceable. We will go over the steps for first getting your project verified then upgrading it into a Campaign on Giveth TRACE.","sidebar":"dapps"},"niceToken":{"id":"niceToken","title":"$nice Token Nedir?","description":"$nice Token, Giveth Organizasyonuna do\u011frudan ba\u011f\u0131\u015flar\u0131 te\u015fvik etmek amac\u0131yla 2022\'nin 3. \xe7eyre\u011finde piyasaya s\xfcr\xfcld\xfc.","sidebar":"dapps"},"projectdonating":{"id":"projectdonating","title":"Bir Projeye Nas\u0131l Ba\u011f\u0131\u015f Yapabilirim?","description":"","sidebar":"dapps"},"projectVerification":{"id":"projectVerification","title":"Proje Do\u011frulama S\xfcreci ve Y\xf6nergeleri","description":"Giveth, bir projenin me\u015fruiyetini g\xf6zden ge\xe7irmek ve GIVbacks program\u0131 arac\u0131l\u0131\u011f\u0131yla bu projelere ba\u011f\u0131\u015f yapanlar\u0131 \xf6d\xfcllendirmek i\xe7in proje do\u011frulamas\u0131n\u0131 kullan\u0131yor. Proje sahipleri do\u011frulama i\xe7in buradan ba\u015fvurabilir.","sidebar":"dapps"},"regenFarmContracts":{"id":"regenFarmContracts","title":"Regen Farm Ak\u0131ll\u0131 Kontrat Rehberi","description":"GIVeconomy, baz\u0131 olanaklar sunmak \xfczere birlikte \xe7al\u0131\u015fan denetimden ge\xe7mi\u015f ak\u0131ll\u0131 kontratlardan olu\u015fan bir koleksiyon olarak de\u011ferlendirilebilir: bunlar aras\u0131nda token streaming, airdrop ve \xe7e\u015fitli farming y\xf6ntemleribulunur. Kontratlar ve script\'lere Giveth giv-token-contracts repository\'den eri\u015febilirsiniz.","sidebar":"dapps"},"regenFarms":{"id":"regenFarms","title":"Regen Farms","description":"RegenFarms, DAO\'lar ve bizim gibi regenler i\xe7in yeni nesil ReFi likidite madencili\u011fi f\u0131rsatlar\u0131d\u0131r. GIVfarm ve GIVstream kontratlar\u0131m\u0131z\u0131 kullanarak, iyiye hizmet eden DAO\'lar\u0131n kendi likidite madencili\u011fi giri\u015fimlerini destekliyoruz. RegenFarm\'lar kendi \xf6d\xfcl ak\u0131\u015flar\u0131na sahip.","sidebar":"dapps"},"styleguide":{"id":"styleguide","title":"Style Guide","description":"Giveth Design by @markoprljic."},"technicalWhitePaper":{"id":"technicalWhitePaper","title":"Technical White Paper","description":"The purpose of our technology is to give cryptocurrency users the ability to donate effortlessly to Campaigns focused on making the world a better place. They can use the Giveth platform to find those Campaigns and donate directly, or they can pledge their crypto to a cause and have a Delegate choose an appropriate Campaign or Trace for them. As an alternative to traditional donation systems, our Liquid Pledging contract allows Givers to take back their pledge if they disagree with how their donations were allocated. This can only occur before it has been locked into a Campaign for a specific purpose.","sidebar":"dapps"},"termsForProposals":{"id":"termsForProposals","title":"Terms & Conditions for Submitting or Challenging a Proposal","description":"1. ACCEPTANCE OF TERMS","sidebar":"dapps"},"testing-guidelines":{"id":"testing-guidelines","title":"Giveth.io Testing Guidelines","description":"This guide provides a framework for testing the Giveth.io DApp.","sidebar":"dapps"},"testingGIVeconomy":{"id":"testingGIVeconomy","title":"GIVeconomy Test Rehberi","description":"GIVeconomy DApp i\xe7in kapsaml\u0131 kullan\u0131c\u0131 testi senaryolar\u0131 i\xe7in bir k\u0131lavuz haz\u0131rlad\u0131k. Testler, https://staging.giveth.io/ adresinde bulunan haz\u0131rlama sunucusunda yap\u0131lmal\u0131d\u0131r.","sidebar":"dapps"},"torusonramp":{"id":"torusonramp","title":"Torus Fiat Para Ge\xe7i\u015fi ile Ba\u011f\u0131\u015f Yapma","description":"","sidebar":"dapps"},"torusUserGuide":{"id":"torusUserGuide","title":"Torus C\xfczdan Kullan\u0131m\u0131","description":"Torus c\xfczdan\u0131, kriptoya yeni ba\u015flayanlar i\xe7in harika bir c\xfczdan se\xe7ene\u011fidir. Web3 teknolojisini kullanarak, se\xe7ti\u011finiz sosyal medya platformu arac\u0131l\u0131\u011f\u0131yla kimli\u011finize ba\u011fl\u0131 bir Ethereum c\xfczdan\u0131 olu\u015fturman\u0131za olanak tan\u0131r. Torus c\xfczdan\u0131 ile kripto para g\xf6nderip alabilir ve Torus \\"c\xfczdan y\xfckleme\\" se\xe7ene\u011fini kullanarak fiat para birimi ile kripto sat\u0131n alabilirsiniz.","sidebar":"dapps"},"traceContracts":{"id":"traceContracts","title":"Contracts, Bridges and Multisigs Technical Information","description":"Contracts:","sidebar":"dapps"},"TRACEinstallation":{"id":"TRACEinstallation","title":"Installing Giveth TRACE for Local Development","description":"This is a comprehensive guide that will walk through new contributors on how to run Giveth TRACE locally. We\'ll be dealing with 2 repos found in the Giveth Github: the giveth-dapp for the front-end and feathers-giveth for smart contract interfacing and the back-end database.","sidebar":"dapps"},"troubleshooting":{"id":"troubleshooting","title":"Sorun Giderme","description":"","sidebar":"dapps"}}}')}}]);